window.bookSummaryJSON = "<p><b>The apocalypse is coming, but only a lucky—or perhaps unlucky—few know.</b></p> <p>Silas is inducted into the System, becoming the last in a long line of Earth's \"forerunners.\" The rewards are great, but the danger is greater. We are not alone in the universe. The fate of five worlds hangs on how their forerunners perform.</p> <p>Will Silas have what it takes to win Earth a place in the multiverse? Or will Earth become another mining world stripped of all resources and left a barren husk floating in the cosmos?</p> <p>A system-enforced secret, a deadly challenge, and only a year to go. The countdown begins now!</p>"; 
